import React, { useState } from 'react';
import './nav_bar.css';

const NavBar = () => {
  const [collapsed, setCollapsed] = useState(false);

  const toggleSubMenu = () => {
    setCollapsed(!collapsed);
  };

  return (
    <div className={`menu ${collapsed ? 'collapsed' : ''}`}>
      <div className="menu-item" onClick={toggleSubMenu}>
        Меню 1
        <span className="arrow"></span>
        <div className="submenu">
          <div className="submenu-item">Подменю 1</div>
          <div className="submenu-item">Подменю 2</div>
          <div className="submenu-item">Подменю 3</div>
        </div>
      </div>
      <div className="menu-item" onClick={toggleSubMenu}>
        Меню 2
        <span className="arrow"></span>
        <div className="submenu">
          <div className="submenu-item">Подменю 4</div>
          <div className="submenu-item">Подменю 5</div>
          <div className="submenu-item">Подменю 6</div>
        </div>
      </div>
      <div className="menu-item" onClick={toggleSubMenu}>
        Меню 3
        <span className="arrow"></span>
        <div className="submenu">
          <div className="submenu-item">Подменю 7</div>
          <div className="submenu-item">Подменю 8</div>
          <div className="submenu-item">Подменю 9</div>
        </div>
      </div>
    </div>
  );
};

export default NavBar;
